import React from 'react';
import BaseLayout from '../components/layouts/BaseLayout';


class Index extends React.Component {

    render() {
        return (
           <BaseLayout>
              <h1> I am Index Page from class Component </h1>
            </BaseLayout>
        )
    }
}

export default Index;
